package types

import "encoding/hex"

// consider using a structured approach with encoding/decoding
func InitialCycleList() [][]byte {
	strs := []string{
		"",

		"",

		"",
	}

	var cycleList [][]byte

	for _, str := range strs {
		bz, err := hex.DecodeString(str)
		if err != nil {
			panic(err)
		}
		cycleList = append(cycleList, bz)
	}

	return cycleList
}
